import React from "react";

function Navbar() {
  return (
    <ul class="nav">
      <li class="nav-item">
        <a class="nav- active" aria-current="page" href="/">
          Google Books
        </a>
      </li>
      <li class="nav-item">
        <a class="nav-link active" aria-current="page" href="/">
          Search
        </a>
      </li>
      <li class="nav-item">
        <a class="nav-link active" href="#">
          Saved
        </a>
      </li>
    </ul>
  );
}

export default Navbar;
